import React from 'react'
import Logo from './../img/Sabor_Badalona.png';
import { Link } from 'react-router-dom';


const handleDestroySession = () => {
  sessionStorage.removeItem('username');
  sessionStorage.removeItem('role');
  window.location.href = '/loginUser';
};
export default function Navbar() {
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-dark">
        <div className="container-fluid">
            <div className="d-flex align-items-center">
              <a href='/' className='text-decoration-none'><img src={Logo} alt="Logo" width="60"  className="rounded-circle me-2 img-fluid w-40" /> <span className="text-decoration-none fs-4 text-black">Cool kids club</span></a>
            </div>
            {sessionStorage.getItem("username") && 
              <div>
                <Link className='btn btn-outline-primary' to="/loginUser">sign in</Link>
              </div>
            }
            {sessionStorage.getItem("username") ? (
                <div>
                  <button className='btn btn-outline-primary' onClick={handleDestroySession}>LogOut</button>
                </div>
            ) : (
                <div>
                  <Link className='btn btn-outline-primary' to="/loginUser">sign in</Link>
                </div>
            )}
            {sessionStorage.getItem("username") ? (
                <div>
                  <button className='btn btn-outline-primary' onClick={handleDestroySession}>LogOut</button>
                </div>
            ) : (
                <div>
                  <Link className='btn btn-outline-primary' to="/adduser">Make an Account</Link>
                </div>
            )}

          </div>
      </nav>
    </div>
  )
}
